window.bookSummaryJSON = "<p>With more than eight million copies of her books in print, Iris Johansen has captured top spots on national best-seller lists and attracted a wide audience of fans. Renowned for her superb storytelling, Johansen adds a dark twist to the well-known fable in <i>The Ugly Duckling</i>. </p> <p>Nell Calder is the docile, plain wife of a powerful financier. She is content to live in the shadows of his elegant international life. Suddenly one night, at a lavish party, a hit man targets her husband. Nellâ€™s face and body are deeply marred by the same violent hand. But from the ensuing surgery and rehabilitation, Nell emerges beautiful, strong, and bent on revenge. To develop the skills she needs to face her attacker, Nell must conquer her fear and face almost impossible odds. </p> <p>Layered with suspense, drama, and passion, this fast-paced story plunges you into Nell's dangerous mission. Narrator Barbara Rosenblat provides the perfect pace for a gripping, sophisticated tale.</p>"; 
